import './Home.css';
import image from '../../assest/zgamer.png';

const Home = () => {
  return (

    <>
    <div className='ContainerHomeBg'>
      <div className="opacity"></div>
      <div className="top">
        <img src={image} alt="" />
      </div>
      <div className="center"></div>
      <div className="bottom"></div>
    </div>
    
    </>
  )
}

export default Home
